var canvas = document.getElementById('canvas');
var ctx = canvas.getContext('2d');

canvas.width = w;
canvas.height = h;
elemLeft = ctx.offsetLeft;
elemTop = ctx.offsetTop;

document.getElementById("bg").src = Images[0];
ctx.drawImage(myImage, 0, 0);
canvas.addEventListener('click', OnClick, false);

var end = [650, 100];

function DrawPath(end) {
    console.log("Draw Path\n");
    ctx.drawImage(myImage, 0, 0);

    var data = ctx.getImageData(0, 0, w, h);

    img_data = Array();
    for (let i = 0; i < w; i++) {
        img_data[i] = Array();
        for (let j = 0; j < h; j++) {
            var offset = (i + j * w) * 4;
            var r = data.data[offset];
            var g = data.data[offset + 1];
            var b = data.data[offset + 2];
            var alpha = data.data[offset + 3];
            if (r + g + b > 300) {
                img_data[i][j] = 0;
            }
            else {
                img_data[i][j] = 1;
            }
        }
    }

    var grid = new PF.Grid(img_data);

    var finder = new PF.AStarFinder({
        allowDiagonal: false,
        dontCrossCorners: true,
        //  heuristic: PF.Heuristic.chebyshev
    });

    var path = finder.findPath(start[1], start[0], end[1], end[0], grid);

    ctx.fillStyle = "#0000FF";
    ctx.fillRect(...start, 8, 8);

    ctx.fillStyle = "#00FF00";
    ctx.fillRect(...end, 8, 8);


    ctx.fillStyle = "#FF0000";

    for (var i in path) {
        ctx.fillRect(path[i][1], path[i][0], 2, 2);
    }

    document.getElementById("canvas").innerHTML = canvas.innerHTML;
}

function changeFloor() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    var ggg = document.getElementById('ggg');
    // myImage.src = Images[(parseInt(ggg.innerText) + 1) % 3];
    document.getElementById("bg").src = Images[(parseInt(ggg.innerText) + 1) % 3];
    w = myImage.width;
    h = myImage.height;
    canvas.width = w;
    canvas.height = h;
    // ctx.drawImage(myImage, 0, 0);
    ggg.innerText = ((parseInt(ggg.innerText) + 1) % 3).toString();
    document.getElementById("canvas").innerHTML = canvas.innerHTML;
}

function OnClick(event) {
    var x = event.pageX,
        y = event.pageY;

    console.log(x, y);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    DrawPath([x, y]);
}

function setfloor(floorNo) {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    myImage.src = Images[floorNo];
    // document.getElementById("bg").src = Images[(parseInt(ggg.innerText) + 1) % 3];
    w = myImage.width;
    h = myImage.height;
    canvas.width = w;
    canvas.height = h;
    ggg.innerText = (floorNo).toString();
    ctx.drawImage(myImage, 0, 0);
    // DrawPath(start);
    document.getElementById("canvas").innerHTML = canvas.innerHTML;
}

