function roomSearch() {
    var searchText = document.getElementById('RoomSearch').value;
    console.log(searchText);
    for (var key in floor1) {
        if (key.search(searchText) != -1) {
            setfloor(0);
            end = floor1[key];
            ctx.drawImage(myImage, 0, 0);
            DrawPath(end);
            return;
        }
    }

    for (var key in floor2) {
        if (key.search(searchText) != -1) {
            setfloor(1);
            end = floor2[key];
            ctx.drawImage(myImage, 0, 0);
            DrawPath(end);
            return;
        }
    }
    document.getElementById("RoomSearch").classList.add("error");
}

document.getElementById("RoomSearch").onclick = function(){
    document.getElementById("RoomSearch").classList.remove("error");
}


